import React from "react";
import CornerIcon from "./CornerIcon";
import Feed from "./Feed";
import { Dropdown, Item, Image } from "semantic-ui-react";

const feeds = [
  {
    name : 'Alan Schneider',
    subject: 'Annual Financial Report'
  }
]

const Notification = () => (
  <div>
    <Feed />

    <Dropdown icon={<CornerIcon />}>
      <Dropdown.Menu>
        <Dropdown.Header content="New messages from " />
        {/* <Dropdown.Item as={<Feed />} /> */}
        <Dropdown.Item text="Rename" description="ctrl + r" />
        <Feed {...feeds[0]}  />

      </Dropdown.Menu>
    </Dropdown>
  </div>
);

export default Notification;
